import React, { useState } from 'react';
import ImageGrid from './ImageGrid'; // ImageGrid 컴포넌트 임포트

function App() {
  const [images] = useState([
    {src: "/img/new_isc.png", title: "정보문화학과 20주년 과제전", project: "A"},
    {src: "/img/makecornpop.gif", title: "Make Corn Pop!", project: "B"},
    {src: "/img/getrelaxed.gif", title: "Get Relaxed", project: "B"}
  ]); // 이미지 데이터를 가져옵니다.

  return (
    <div className="app">
      <ImageGrid images={images} />
    </div>
  );
}

export default App;
